-- ----------------------------
-- View structure for vista_usuarios
-- ----------------------------
DROP VIEW IF EXISTS `vista_usuarios`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `vista_usuarios` AS select usuarios.id,personas.nombre,personas.aPaterno,personas.aMaterno,personas.fechaNac,rol.descrpcion,usuarios.foto from usuarios
inner join personas on usuarios.id_persona = personas.id_persona
inner join rol on usuarios.id_rol = rol.id_rol ;

-- ----------------------------
-- Procedure structure for eliminar_categoria
-- ----------------------------
DROP PROCEDURE IF EXISTS `eliminar_categoria`;
delimiter ;;
CREATE PROCEDURE `eliminar_categoria`(in _idcategoria int)
begin
update categoria set estado = 0 where idcategoria = _idcategoria;
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for insertar_categoria
-- ----------------------------
DROP PROCEDURE IF EXISTS `insertar_categoria`;
delimiter ;;
CREATE PROCEDURE `insertar_categoria`(in _nombre varchar(50), in _descripcion varchar(255))
begin
insert into categoria (nombre,descripcion) values (_nombre, _descripcion);
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for leer_idcategoria
-- ----------------------------
DROP PROCEDURE IF EXISTS `leer_idcategoria`;
delimiter ;;
CREATE PROCEDURE `leer_idcategoria`(in _idcategoria int)
begin
Select * from categoria where idcategoria = _idcategoria;
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for login
-- ----------------------------
DROP PROCEDURE IF EXISTS `login`;
delimiter ;;
CREATE PROCEDURE `login`(IN _Nombre varchar(50),IN _Clave varchar(255),IN _Rol int)
BEGIN
select usuarios.id,personas.nombre,usuarios.clave,rol.id_rol from usuarios
inner join personas on usuarios.id_persona = personas.id_persona
INNER JOIN rol on usuarios.id_rol = rol.id_rol
where personas.nombre like _Nombre and usuarios.clave = _Clave and rol.id_rol= _Rol;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for modificar_categoria
-- ----------------------------
DROP PROCEDURE IF EXISTS `modificar_categoria`;
delimiter ;;
CREATE PROCEDURE `modificar_categoria`(in _nombre varchar(50), in _descripcion varchar(255),in _idcategoria int)
begin
update categoria set nombre=_nombre, descripcion=_descripcion where idcategoria=_idcategoria;
end
;;
delimiter ;

